import styled from "styled-components";
import im1 from "./img/1.jpg";
import im2 from "./img/2.png";
import im3 from "./img/3.png";
import im4 from "./img/4.png";
import im5 from "./img/5.png";
import im6 from "./img/6.png";
import im7 from "./img/7.png";
import im8 from "./img/8.png";
import im9 from "./img/9.png";

const Para = styled.p`
  position: absolute;
  width: 310px;
  height: 56px;
  left: 52px;
  top: 153px;

  font-family: "Rubik", sans-serif;
  font-style: normal;
  font-weight: normal;
  font-size: 20px;
  line-height: 28px;
  /* or 140% */

  text-align: center;
  letter-spacing: 0.02em;

  color: #495057;
`;

const Img1 = styled.img`
  position: absolute;
  left: -5.07%;
  right: 54.83%;
  top: 28.24%;
  margin-top: 44px;
  bottom: 56.47%;
  border-radius: 4px;
`;
const Img2 = styled.img`
  position: absolute;
  left: 47.83%;
  right: 20.29%;
  top: 28.24%;
  bottom: 56.58%;
  border-radius: 4px;
`;
const Img3 = styled.img`
  position: absolute;
  left: 82.37%;
  right: -36.96%;
  top: 28.24%;
  bottom: 56.47%;
  border-radius: 4px;
`;
const Img4 = styled.img`
  position: absolute;
  left: -18.84%;
  left: 0%;
  right: 68.36%;
  top: 44.75%;
  bottom: 40.07%;
  border-radius: 4px;
`;
const Img5 = styled.img`
  position: absolute;
  left: 34.06%;
  right: 34.06%;
  top: 44.75%;
  bottom: 40.07%;

  border-radius: 4px;
`;
const Img6 = styled.img`
  position: absolute;
  left: 68.6%;
  right: -25.36%;
  top: 44.75%;
  bottom: 40.07%;
  border-radius: 4px;
`;
const Img7 = styled.img`
  position: absolute;
  left: -78.26%;
  left: 0%;
  right: 88.65%;
  top: 61.16%;
  bottom: 23.55%;
  border-radius: 4px;
`;
const Img8 = styled.img`
  position: absolute;
  left: 13.77%;
  right: 54.35%;
  top: 61.16%;
  bottom: 23.55%;
  border-radius: 4px;
`;
const Img9 = styled.img`
  position: absolute;
  left: 48.31%;
  right: -25.36%;
  top: 61.16%;
  bottom: 23.55%;
  border-radius: 4px;
`;

export const PageOne = (props) => {
  return (
    <>
      {props.children}
      <Para>
        Letâ€™s find informative blogs to follow based on your interests.
      </Para>
      <Img1 src={im1} alt="" />
      <Img2 src={im2} alt="" />
      <Img3 src={im3} alt="" />
      <Img4 src={im4} alt="" />
      <Img5 src={im5} alt="" />
      <Img6 src={im6} alt="" />
      <Img7 src={im7} alt="" />
      <Img8 src={im8} alt="" />
      <Img9 src={im9} alt="" />
    </>
  );
};
